import './App.css';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Navbar from './components/navbar/Navbar'
import Home from './pages/Home'

function App() {
  return (
    <Router>
      <Routes>
      <Route exact path="/" component={Home} />
      </Routes>
    </Router>
  );
}

export default App;
